import {useEffect, useState} from 'react';
import logo from './logo.svg';
import './App.css';
import $ from 'jquery';
import { RennderComponents } from './components/RenderComponent';

function App() {
  const [componentData, setComponentData] = useState({})
  const [openModal, setOpenModal] = useState(true)
  useEffect(() => {
    $.ajax({
      url: '/data2.json',
      dataType:'json',
      cache: false,
      success: (data) => {
        setComponentData(data)
      },
      error: (xhr, status, err) => {
        console.error(err)
      }
    })
  },[])
  function handleClick({component, cbdata}) {
    console.log("idhar ghusa")
    switch (component) {
      case 'modal':
        setOpenModal(cbdata)
        break;

      default:
        break;
    }
  }
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      {componentData && Object.keys(componentData).length > 0 && Object.getPrototypeOf(componentData) === Object.prototype && RennderComponents(componentData, openModal, handleClick)}
    </div>
  );
}

export default App;
